import React from 'react';

function Contact(){
    return (
        <div>
            <h1> Contact Me </h1>
            <form>
                <label>
                    Name:
                    <input type="text" name="name" />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default Contact;
